import {React} from 'react';
import {Navbar} from './Navbar';
import {Footer} from './Footer';
import { Home } from './Home';
import {Services} from './Services';


class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Welcome to Techbitz</h1>
        <Navbar />
        <Home />
        <Services />
        <Footer />
      </div>
    );
  }
}

export default App;
